db.patients.aggregate([
     { $project: {
         IMAGING_STUDIES: {
             $filter: {
                 input: "$IMAGING_STUDIES",
                 as: "imagingStudy",
                 cond: { $eq: [ "$$imagingStudy.IMAGING_STUDY_ID", "ee88b224-1f91-8c6a-493a-46e8004c4331" ] }
             }
         }
     }},
     { $unwind: "$IMAGING_STUDIES" },
     { $project: {
         BODYSITE_CODE: "$IMAGING_STUDIES.BODYSITE_CODE",
         BODYSITE_DESCRIPTION: "$IMAGING_STUDIES.BODYSITE_DESCRIPTION"
     }}
 ])

db.patients.aggregate([
	{ $unwind: "$IMAGING_STUDIES" },
	{ $match: { "IMAGING_STUDIES.DESCRIPTION": "Influenza  seasonal  injectable  preservative free" } },
	{ $group: { _id: "$PATIENT_ID" } },
	{ $project: { _id: 0, patient_id: "$_id" } }
])

db.patients.aggregate([
 {$unwind: "$ENCOUNTERS.SUPPLIES"},
 {$match: {"ENCOUNTERS.SUPPLIES.DESCRIPTION": "Continuous positive airway pressure nasal oxygen cannula (physical object)"}},
 {$project: {_id: 0, code: "$ENCOUNTERS.SUPPLIES.CODE"}}
])

db.patients.aggregate([
     { $lookup: {
         from: "payers",
         localField: "HEALTHCARE_COVERAGE",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: { "payer.PAYER_ID": "0133f751-9229-3cfd-815f-b6d4979bdd6a" } },
     { $project: { payer: 0 } }
])

db.patients.aggregate([
     { $unwind: "$ENCOUNTERS" },
     { $unwind: "$ENCOUNTERS.MEDICATIONS" },
     { $match: { "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Warfarin Sodium 5 MG Oral Tablet" } },
     { $project: { _id: 0, medication_cost: "$ENCOUNTERS.MEDICATIONS.TOTAL_COST" } }
])

db.patients.aggregate([
     { $project: {
         "IMAGING_STUDIES": {
             $filter: {
                 input: "$IMAGING_STUDIES",
                 as: "imagingStudy",
                 cond: { $eq: ["$$imagingStudy.SERIES_UID", "1.2.840.99999999.1.30162925.1683721997276"] }
             }
         }
     }},
     { $unwind: "$IMAGING_STUDIES" },
     { $project: { _id: 0, patient_id: "$_id", series_uid: "$IMAGING_STUDIES.SERIES_UID" } }
 ])

db.patients.aggregate([
     { $unwind: "$ENCOUNTERS" },
     { $lookup: {
         from: "payers",
         localField: "ENCOUNTERS.PAYER_REF",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: {
         "payer.PAYER_ID": "e03e23c9-4df1-3eb6-a62d-f70f02301496",
         "ENCOUNTERS.PAYER_COVERAGE": { $eq: 0 }
     }},
     { $group: { _id: null, count: { $sum: 1 } } },
     { $project: { _id: 0, count: 1 }}
 ])

db.patients.aggregate([
 {$unwind: "$IMAGING_STUDIES"},
 {$match: {"IMAGING_STUDIES.DESCRIPTION": "Influenza seasonal injectable preservative free"}},
 {$project: {_id: 0, date: "$IMAGING_STUDIES.DATE"}}
])

db.patients.aggregate([
 {$unwind: "$IMMUNIZATIONS"},
 {$match: {"IMMUNIZATIONS.DESCRIPTION": "Td (adult)  5 Lf tetanus toxoid  preservative free  adsorbed"}},
 {$project: {_id: 0, cost: "$IMMUNIZATIONS.BASE_COST"}}
])

db.patients.aggregate([
    { $lookup: {
        from: "organizations",
        localField: "ADDRESS",
        foreignField: "ADDRESS",
        as: "org_info"
    }},
    { $unwind: "$org_info" },
    { $match: { "org_info.NAME": "LEOMINSTER COMUNITY HEALTH CENTER" } },
    { $project: { _id: 0, patient_name: { $concat: [ "$PREFIX", " ", "$FIRST", " ", "$LAST", " ", "$SUFFIX" ] } } }
])

db.patients.aggregate([
     { $unwind: "$ENCOUNTERS" },
     { $lookup: {
         from: "payers",
         localField: "ENCOUNTERS.PAYER_REF",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: {
         "payer.PAYER_ID": "0133f751-9229-3cfd-815f-b6d4979bdd6a",
         "ENCOUNTERS.PAYER_COVERAGE": { $eq: 0 }
     }},
     { $group: { _id: null, count: { $sum: 1 } } },
     { $project: { _id: 0, count: 1 }}
 ])

db.patients.aggregate([
     { $lookup: {
         from: "payers",
         localField: "HEALTHCARE_COVERAGE",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: { "payer.PAYER_ID": "b046940f-1664-3047-bca7-dfa76be352a4" } },
     { $project: { payer: 0 } }
])

db.patients.aggregate([
     { $unwind: "$IMMUNIZATIONS" },
     { $lookup: {
         from: "payers",
         localField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: { "payer.PAYER_ID": "26aab0cd-6aba-3e1b-ac5b-05c8867e762c", "IMMUNIZATIONS.BASE_COST": { $gt: 0 } } },
     { $group: {_id: null, count: {$sum: 1}}},
     { $project: { _id: 0, count: 1 }}
 ])

db.patients.aggregate([
     { $match: {
         "PREFIX": "Caleb",
         "FIRST": "651",
         "LAST": "Dickinson688"
     }},
     { $unwind: "$ENCOUNTERS" },
     { $unwind: "$ENCOUNTERS.PROCEDURES" },
     { $project: {
         _id: 0,
         patient_name: {
             PREFIX: "$PREFIX",
             FIRST: "$FIRST",
             LAST: "$LAST"
         },
         procedure_description: "$ENCOUNTERS.PROCEDURES.DESCRIPTION"
     }}
 ])

db.CLAIMS.aggregate([
     { $unwind: "$CLAIM_TRANSACTIONS" },
     { $group: {
         _id: {
             patient: "$PROVIDER_REF",
             payer: "$PRIMARY_PATIENT_INSURANCE_REF"
         },
         total_uncovered: { $sum: { $cond: [ { $eq: [ "$CLAIM_TRANSACTIONS.METHOD", "U" ] }, "$CLAIM_TRANSACTIONS.AMOUNT", 0 ] } }
     }},
     { $match: { "payer": { $eq: ObjectId("MEDICARE_PAYER_ID") } } },
     { $group: { _id: null, total_uncovered_by_medicare: { $sum: "$total_uncovered" } } },
     { $project: { _id: 0 } }
])

db.patients.aggregate([
     { $unwind: "$IMMUNIZATIONS" },
     { $lookup: {
         from: "payers",
         localField: "CLAIMS.PRIMARY_PATIENT_INSURANCE_REF",
         foreignField: "PAYER_ID",
         as: "payer"
     }},
     { $unwind: "$payer" },
     { $match: {
         "payer.PAYER_ID": "8fa6c185-e44e-3e34-8bd8-39be8694f4ce",
         "IMMUNIZATIONS.BASE_COST": { $gt: 0 },
         "payer.AMOUNT_COVERED": { $eq: 0 }
     }},
     { $group: { _id: null, count: { $sum: 1 } } },
     { $project: { _id: 0, count: 1 } }
 ])
